import VueRouter from "vue-router";

const routes = [
    {
        path: '/',
        name: 'login',
        component: ()=>import('../components/Login')
    },
    {
        path: '/Index',
        name: 'index',
        component: ()=>import('../components/Index'),
        children: [
            {
                path: '/Home',
                name: 'home',
                mata:{
                    title:'扶뒬못'
                },
                component: () => import('../components/Home.vue')
            }
        ]
    }
]

const router = new VueRouter({
    mode:'history',
    routes
})

export default router;
